function Filter() {
  return (
    <>
      <hr className="h-px my-4 bg-gray-200" />
      <h4 className="font-medium text-lg text-gray-700 mb-4">Price</h4>
      <input type="checkbox" className="w-4 h-4" />
      <label className="text-sm ml-2">{`Below $1000`}</label>
      {[1000, 2000, 3000].map((price) => (
        <div>
          <input type="checkbox" className="w-4 h-4 my-1" />
          <label className="text-sm ml-2">{`$${price} - ${
            price + 1000
          }`}</label>
        </div>
      ))}
      <input type="checkbox" className="w-4 h-4" />
      <label className="text-sm ml-2">{`Above $4000`}</label>
      <hr className="h-px my-4 bg-gray-200" />
      <h4 className="font-medium text-lg text-gray-700 mb-4">Offers</h4>
      {["10", "20", "30"].map((discount) => (
        <div>
          <input type="checkbox" value={discount} className="w-4 h-4 my-1" />
          <label className="text-sm ml-2">{`${discount}% above`}</label>
        </div>
      ))}
      <hr className="h-px my-4 bg-gray-200" />
      <h4 className="font-medium text-lg text-gray-700">Color</h4>
      <div className="w-9/12 mt-2">
        {[
          "blue",
          "gray",
          "green",
          "indigo",
          "pink",
          "purple",
          "red",
          "yellow",
        ].map((color) => (
          <div className="inline-block w-5/12 *:m-auto text-center mt-5">
            <div className={`w-4 h-4 bg-${color}-400 rounded-xl`}></div>
            <span className="font-medium text-sm">{color}</span>
          </div>
        ))}
      </div>
      <hr className="h-px my-4 bg-gray-200" />
      <h4 className="font-medium text-lg text-gray-700 mb-4">Size</h4>
      {[5, 5.5, 6, 6.5, 7, 7.5, 8, 8.5, 9, 9.5, 10, 10.5, 11, 11.5, 12].map(
        (size) => (
          <div className="w-2/6 inline-block hover:border-gray-700 text-sm text-center border border-gray-200 rounded-md py-2 m-1 cursor-pointer">
            {size}
          </div>
        ),
      )}
    </>
  );
}

export default Filter;
